"""# Задание 3

Цель - создать менеджера команды Pokémon, который позволит пользователям:

- Добавлять покемонов в свою команду. (если такого покемона еще нет в команде)
- Удалять покемонов из их команды.
- Просматривать подробную информацию обо всех покемонах в команде.
- Находить покемона по имени.
- Устраивать тренировочный бой между двумя покемонами

Для данной задачи используйте: https://pokeapi.co/
"""

import requests

def add(team, pkmn):
    if pkmn not in team:
        team.append(pkmn)
        print(f"{pkmn['name'].capitalize()} добавлен!")
    else:
        print(f"{pkmn['name'].capitalize()} уже в команде.")

def remove(team, name):
    team[:] = [p for p in team if p['name'] != name.lower()]
    print(f"{name.capitalize()} удален.")

def show(team):
    if team:
        for p in team:
            print(f"{p['name'].capitalize()} (ID: {p['id']}, Типы: {', '.join(p['types'])})")
    else:
        print("Команда пуста.")

def fight(team, p1_name, p2_name):
    p1, p2 = [p for p in team if p['name'] == p1_name.lower()], [p for p in team if p['name'] == p2_name.lower()]
    if p1 and p2:
        p1, p2 = p1[0], p2[0]
        print(f"Бой: {p1['name'].capitalize()} vs {p2['name'].capitalize()}")
        winner = p1 if p1['stats']['attack'] > p2['stats']['attack'] else p2
        print(f"Победитель: {winner['name'].capitalize()}")
    else:
        print("Ошибка: Покемоны не найдены.")

def get_data(name):
    url = f'https://pokeapi.co/api/v2/pokemon/{name.lower()}'
    data = requests.get(url).json()
    return {
        'name': data['name'],
        'id': data['id'],
        'types': [t['type']['name'] for t in data['types']],
        'stats': {s['stat']['name']: s['base_stat'] for s in data['stats']}
    }

def get_list(limit=10):
    return [pokemon['name'] for pokemon in requests.get(f'https://pokeapi.co/api/v2/pokemon?limit={limit}').json()['results']]

def main():
    team = []
    while True:
        available = get_list()
        print("\nДоступные покемоны:")
        for i, p in enumerate(available, 1):
            print(f"{i}. {p.capitalize()}")

        choice = input("\nВыберите покемона (или 'выход' для завершения): ").strip().lower()
        if choice == 'выход':
            break

        if choice.isdigit() and 1 <= int(choice) <= len(available):
            pkmn = get_data(available[int(choice)-1])
            action = input(f"Добавить или удалить {pkmn['name'].capitalize()}? (1: Добавить, 2: Удалить): ").strip()
            if action == '1':
                add(team, pkmn)
            elif action == '2':
                remove(team, pkmn['name'])

        print("\nТекущая команда:")
        show(team)

        if len(team) >= 2:
            action = input("\nБой (1) или выход (2): ").strip()
            if action == '1':
                print("\nВыберите покемонов для боя:")
                for i, p in enumerate(team, 1):
                    print(f"{i}. {p['name'].capitalize()}")
                p1, p2 = int(input("Первый покемон: "))-1, int(input("Второй покемон: "))-1
                fight(team, team[p1]['name'], team[p2]['name'])
            elif action == '2':
                print("Выход.")
                break

if __name__ == "__main__":
    main()